import React from "react";

function Nav() {
  return (
    <nav className="navbar navbar-expand-lg navbar-dark bg-primary">
      <a className="navbar-brand" href="/">
        Welcome to the Baffoonery!!! 
      </a>
      <Button variant="contained" color="primary">
        Primary
      </Button>
    </nav>
  );
}

export default Nav;
